import React from 'react';
import HeaderSideDoValente from './index.js';

export const moHeaderSideDoValente = (modo) => (
    <div>
      <h2>moHeaderSideDoValente</h2>
        <HeaderSideDoValente/>
        modo={modo}
    </div>
);

export default moHeaderSideDoValente;
